  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Zones are derived from a focal mean
  analysis on bathymetry and slope. The bathymetry grid (5 m cell size) is derived
  from bathymetry from two sources: Multibeam bathymetry collected by Coral Reef Ecosystem
  Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry collected
  aboard the US Naval Ship Sumner by the Naval Oceanographic Office, and lidar, also
  collected by the Naval Oceanographic Office. BPI Zones was created using the Benthic
  Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell values represent one
  of four classes in an index of seafloor terrain; flats, depressions, crests and
  slopes. This data set is for Saipan Islands, Commonwealth of the Northern Marianas
  (CNMI).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
